import React, { useEffect } from 'react';
import s from './Card.module.css';
import { useHistory } from 'react-router-dom';



export default function Card({name, id}) {

  const capitalizeName = function(name){

    let ans = name.charAt(0).toUpperCase() + name.slice(1);

    if (ans === 'Mr-mime'){
      ans = 'Mr. Mime';
    }

    return (<p>{ans}</p>)
    
  } 

  return (
      <div  className={s.container}>
          <p className={s.name} >{capitalizeName(name)}</p>
          <img className={s.img} src={`https://unpkg.com/pokeapi-sprites@2.0.2/sprites/pokemon/other/dream-world/1.svg`}></img>
      </div>
    )
  };
